value.Description:
ColorPicker [SA:MP] is a simple tool that generates: 
- PAWN Hex Color Codes (useful for SAMP Scripts);
- ARGB Color Codes;
- HTML Color Codes;

It's developed in C#.

This library handles the common task of reading arguments from a command line and filling in the values in an object. Argument specification is inferred from the type defintion of the provided argument object. The argument specification may be overriden with attributes. Will gerneate human readable error messages as well as human readable usage message. By default messages go to the console window, though the destination may be overridden.

The library's primary goals are simplicity for the programmer and a consistent syntax for the user.


Usage:

class ApplicationArguments {
    public bool lines;
    public string filename;
}

...
ApplicationArguments parsedArguments = new ApplicationArguments();
if (CommandLine.Parser.ParseArgumentsWithUsage(parsedArguments))
    // success
else
    // parse error

This Windows application can search a source code directory for possible Gang of Four design patterns.
Works with .cs, .vb, .java and .php file extensions.

Other features:
- Save results to .txt file;
- Configure design pattern definitions through xml file;
- Filter results by pattern;
- Open source code file from the application;
- Option to search in source code file content.
